import React from 'react';

function Visuals() {
  return (
    <div>
      <h1>This is a Visual Component</h1>
      <p>This component is imported only for visuals or static HTML.</p>

      <div style={{width: '1361px', height: '219px', background: '#9F2121', marginTop: '41px', marginLeft: '34px', marginRight: '45px'}}>
      <div style={{width: '100%', height: '100%', color: 'black', fontSize: 32, fontFamily: 'Inter', fontWeight: '400', wordWrap: 'break-word'}}>SUBSCRIBE</div>
    </div>
      

    </div>
    
  );
}

export default Visuals;
